window.bookSummaryJSON = "<p><b>Hugo Award Winner for Best Series</b></p> <p>The sixth book in the <i>NYT</i> best-selling Expanse series, <i>Babylon's Ashes</i> has the galaxy in full revolution, and it's up to the crew of the Rocinante to make a desperate mission to the gate network and thin hope of victory. Now a Prime Original series.</p> <p>A revolution brewing for generations has begun in fire. It will end in blood.</p> <p>The Free Navy - a violent group of Belters in black-market military ships - has crippled the Earth and begun a campaign of piracy and violence among the outer planets. The colony ships heading for the thousand new worlds on the far side of the alien ring gates are easy prey, and no single navy remains strong enough to protect them.</p> <p>James Holden and his crew know the strengths and weaknesses of this new force better than anyone. Outnumbered and outgunned, the embattled remnants of the old political powers call on the Rocinante for a desperate mission to reach Medina Station at the heart of the gate network.</p> <p>But the new alliances are as flawed as the old, and the struggle for power has only just begun.</p> <p><i>Babylon's Ashes </i>is a breakneck science fiction adventure following the best-selling <i>Nemesis Games</i>.</p> <p><b>The Expanse</b></p> <p></p> <ul> <li><i>Leviathan Wakes</i></li> <li><i>Caliban's War</i></li> <li><i>Abaddon's Gate</i></li> <li><i>Cibola Burn</i></li> <li><i>Nemesis Games</i></li> <li><i>Babylon's Ashes</i></li> <li><i>Persepolis Rising</i></li> <li><i>Tiamat's Wrath</i></li> <li><i>â€‹Leviathan Falls</i></li> <li><i>Memory's Legion</i> </li> </ul> <p><b>The Expanse Short Fiction</b></p> <p></p> <ul> <li><i>Drive</i></li> <li><i>The Butcher of Anderson Station</i></li> <li><i>Gods of Risk</i></li> <li><i>The Churn</i></li> <li><i>The Vital Abyss</i></li> <li><i>Strange Dogs</i></li> <li><i>Auberon</i></li> <li><i>The Sins of Our Fathers</i></li> </ul>"; 
